import React from 'react';
// import './profile.css';

function Profile(props) {
    if (props.user) {
    return (
        <div className="flex-container">
            <h2>Profile Page</h2>
            <h3>Name: {props.user.name.first} {props.user.name.last}</h3>
            < img src={props.user.picture.large} alt="user" />
            <p>Country: {props.user.location.country}</p>
            <p><em>Password: {props.user.login.password} ...shhhh</em></p>
        </div>
    )
}
    else {
        return (
            <div className="flex-container">
                <p>You must be logged in!</p>
            </div>
        )
    }
}

export default Profile;
